import React, { useState, useEffect } from "react";

// Example API URLs (update if your backend port changes)
const AUTH_API = "http://127.0.0.1:9358/api/auth";
const PRESCRIPTIONS_API = "http://127.0.0.1:9358/api/prescriptions";

function App() {
  const [message, setMessage] = useState("");
  const [prescriptions, setPrescriptions] = useState([]);

  // Example: test backend connection
  useEffect(() => {
    fetch(AUTH_API)
      .then((res) => res.json())
      .then((data) => setMessage("Backend connected: " + JSON.stringify(data)))
      .catch((err) => setMessage("Error connecting to backend"));
  }, []);

  // Example: fetch prescriptions
  const loadPrescriptions = () => {
    fetch(PRESCRIPTIONS_API)
      .then((res) => res.json())
      .then((data) => setPrescriptions(data))
      .catch((err) => console.error(err));
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h1>üè• Healthcare App - Member 2</h1>

      <h2>Status:</h2>
      <p>{message || "Connecting..."}</p>

      <h2>Prescriptions:</h2>
      <button onClick={loadPrescriptions}>Load Prescriptions</button>
      <ul>
        {prescriptions.length > 0 ? (
          prescriptions.map((p) => (
            <li key={p._id}>
              {p.patientName} - {p.medicine} - {p.dosage}
            </li>
          ))
        ) : (
          <p>No prescriptions loaded</p>
        )}
      </ul>
    </div>
  );
}

export default App;
